(51, '0498ab5942d0c8bb7f638c426f9f2c07', '36514', 'Etecsa prestara el servicio de Hospedaje Web en los servidores de su propiedad para sitios web, dominios e informacion en soporte digital pertenecientes al CLIENTE, proveyendo a este de los componentesy sistemas en linea necesarios para el almanecamiento de texto, imagenes, video u otro contenido accesible via web; y el CLIENTE se obliga a pagar por el servicio en dependencia de la capacidad de almacenamiento y otras funcionalidades contratadas, segun se relaciona en el modelo que se adjunta como Anexo No. 1 del presente Contrato', 0, '2020-06-17 22:53:33', '0000-00-00 00:00:00', 1, NULL, NULL, NULL),
(52, 'dc384cb3d4d6be360e0bb8052e569358', '20', '1.1 El VENDEDOR se obliga a entregar y cobrar los productos en las cantidades, precios y demas especificaciones acordads en el Anexo No. 1 que forma parte del presente Instrumento Legal, y El COMPRADOR a recibir y pagar por estos \n1.2 El VENDEDOR entregara al COMPRADOR conjuntamente con la mercancia, la factura y servira a este ultimo para que emita el cheque u otro instrumento de pago acordado, debiendo estar firmada por quien recibe, como representante del COMPRADOR ', 0, '2020-10-01 22:53:19', '2025-10-01 22:53:19', 1, NULL, NULL, NULL),
(53, 'aa17da01dc1f4ac314c2deeb8ca932f3', '1/2015', 'El presente Contrato tiene como objeto determinar las condiciones generales mediante las cuales El PRESTADOR brinda SERVICIOS DE PROGRAMACION DE EQUIPOS DE COMPUTO y establecer el compromiso de pago por parte del CLIENTE ', 0, '2013-12-07 23:05:39', '0000-00-00 00:00:00', 11, NULL, NULL, NULL),
(54, '2fc5a4a3895372bcb4e53ad1b8febe84', '27/2017', 'Este Contrato tiene como objeto determinar las condiciones generales mediante las cuales EL PRESTADOR brinda Servicios Cinetifico-Tecnicos de ASESORIA TECNICA EN TEMAS DE PROPIEDAD INTELECTUAL, que se definen y detallan en el Anexo 1, los que se realizaran por solicitudes del cliente mediante la facturacion de los mismos, asi como establecer el Compromiso de Pago por parte del CLIENTE', 0, '2017-02-20 23:25:21', '2019-02-20 23:25:21', 11, NULL, NULL, NULL);
