r;\" type=\"text\"></u><span style=\"mso-bidi-font-weight:bold\">, </span>con\r\ndomicilio legal en <u><input size=\"21\" restriction=\"\" value=\"Dirección del cliente\" id=\"9a7fd8bec8a9f966f4236a61b2681cb3\" mapping=\"Client;address\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, <u><input size=\"24\" restriction=\"\" value=\"Localización del cliente\" id=\"61e9bc6ec5e5c237577e5825a0282b25\" mapping=\"Client;Location;name\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, registrada al Código REEUP <u><input size=\"25\" restriction=\"\" value=\"REEUP/Patente del cliente\" id=\"2e89c577ff59c31800f31e5f1a70782c\" mapping=\"Client;specialcode\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, Cuenta Bancaria en <u><input size=\"19\" restriction=\"spaceseparatedsingleline\" value=\"Cuentas del cliente\" id=\"09792853ada5eebf9d9ed5e14306dd3c\" mapping=\"Client:decode[name,officetitle,office,accounttitle,account,currencytitle,currency],accounts;profile\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, ante esa instancia comparezco y conforme a\r\nderecho:</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"margin-right:23.75pt;text-align:center;\r\ntab-stops:21.3pt\" align=\"center\"><b><u><span style=\"font-size:6.0pt;mso-bidi-font-size:\r\n8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"margin-right:23.75pt;text-align:center;\r\ntab-stops:21.3pt\" align=\"center\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES\">DIGO:</span></u></b></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"margin-right:23.75pt;tab-stops:21.3pt\"><b><u><span style=\"font-size:6.0pt;mso-bidi-font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:21.25pt;text-align:justify;mso-pagination:\r\nnone;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\">Que\r\nvengo por medio de este escrito a establecer formal <b style=\"mso-bidi-font-weight:\r\nnormal\">Reclamación</b> contra la<b> <u><input size=\"45\" restriction=\"\" value=\"Denominación/Nombre y Apellidos del proveedor\" id=\"49030fe895c9212dc79f32f8513c32b9\" mapping=\"Provider;name\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, </b><span style=\"mso-bidi-font-weight:bold\">que\r\nusted dirige,</span>con domicilio legal en <u><input size=\"23\" restriction=\"\" value=\"Dirección del proveedor\" id=\"d2c56834be5ef2462c4acad032d26951\" mapping=\"Provider;address\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> <u><input size=\"26\" restriction=\"\" value=\"Localización del proveedor\" id=\"4fcbae86f90b1ee1650ff82fdc21abf3\" mapping=\"Provider;Location;name\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, registrada al Código REEUP <u><input size=\"27\" restriction=\"\" value=\"REEUP/Patente del proveedor\" id=\"0929639b7e7732ce9bb3bd0d781295ee\" mapping=\"Provider;specialcode\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, Cuenta Bancaria en <u><input size=\"21\" restriction=\"spaceseparatedsingleline\" value=\"Cuentas del proveedor\" id=\"4ae5475722af4888edaf30a391eca1ba\" mapping=\"Provider:decode[name,officetitle,office,accounttitle,account,currencytitle,currency],accounts;profile\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, por incumplimiento de las obligaciones contractuales\r\ncontraídas por su entidad y fundamento la Reclamación en los\r\nsiguientes:</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:13.4pt;text-align:justify;mso-pagination:\r\nnone;mso-layout-grid-align:none;text-autospace:none\"><b><u><span style=\"font-size:6.0pt;mso-bidi-font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:23.75pt;text-align:center;\r\nmso-pagination:none;mso-layout-grid-align:none;text-autospace:none\" align=\"center\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">HECHOS</span></u></b><b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:23.75pt;text-align:center;\r\nmso-pagination:none;mso-layout-grid-align:none;text-autospace:none\" align=\"center\"><b><span style=\"font-size:6.0pt;mso-bidi-font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify;mso-pagination:\r\nnone;mso-layout-grid-align:none;text-autospace:none\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">PRIMERO</span></u></b><b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">:</span></b><span style=\"font-family:\r\n&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">\r\nQue entre ambas entidades existen relaciones monetarias mercantiles, amparado\r\nde Contrato de <u><input size=\"16\" restriction=\"\" value=\"Tipo de contrato\" id=\"5c6c915c18c0e37400ff1081ce5ac96d\" mapping=\"Contracttype;name\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> No.<u><input size=\"19\" restriction=\"\" value=\"Número del contrato\" id=\"name\" mapping=\"Event;name\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> de fecha <u><input size=\"27\" restriction=\"\" value=\"Fecha de firma del contrato\" id=\"start_with_format\" mapping=\"Event;start_with_format\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify;mso-pagination:\r\nnone;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:6.0pt;mso-bidi-font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:red;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"margin-right:14.15pt\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">SEGUNDO</span></u></b><b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">:</span></b><span style=\"font-family:\r\n&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">\r\nQue __________________________ (se expone la cláusula incumplida del contrato por\r\nel demandado)</span><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-fareast-font-family:Arial;mso-bidi-font-family:Arial;color:black\" lang=\"ES\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><b style=\"mso-bidi-font-weight:normal\"><u><span style=\"font-size:6.0pt;\r\nmso-bidi-font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;color:red\" lang=\"ES\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">TERCERO</span></u></b><b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">:</span></b><span style=\"font-family:\r\n&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">\r\nQue ___________________________ (ampliación de los hechos exponiendo cifras,\r\ncantidades, plazos, detalles de lo que promueve la reclamación en sí)</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><b style=\"mso-bidi-font-weight:normal\"><u><span style=\"font-size:\r\n6.0pt;mso-bidi-font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:red;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><b style=\"mso-bidi-font-weight:normal\"><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES\">CUARTO:</span></u></b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\"> </span><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">En la cláusula ________ se pactó entre <b style=\"mso-bidi-font-weight:normal\">LAS PARTES</b> que, de surgir\r\nincumplimientos del contrato, estas tendrán derecho a exigirse una sanción\r\npecuniaria.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\"><span style=\"mso-spacerun:yes\">&nbsp;</span>(se\r\nbusca la cláusula de sanción pecuniaria y se expone tal cual aparece en el\r\ncontrato).</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><span style=\"font-size:6.0pt;mso-bidi-font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:red\" lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><b style=\"mso-bidi-font-weight:normal\"><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES\">QUINTO:</span></u></b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\"> En la\r\ncláusula ________ se estableció que las reclamaciones referentes a lo pactado\r\nen las cláusulas del contrato deberán presentarse a la otra parte por escrito\r\nen el domicilio legal de la otra parte, ya sea de forma personal o través de\r\ncorreo certificado, siendo la fecha de acuse de recibo, la aceptada por la\r\nparte reclamada, como fecha de presentación.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><span style=\"font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:red\" lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;mso-pagination:none;\r\nmso-layout-grid-align:none;text-autospace:none\" align=\"center\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\">FUNDAMENTOS\r\nDE DERECHO:</span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;mso-pagination:none;\r\nmso-layout-grid-align:none;text-autospace:none\" align=\"center\"><b><u><span style=\"font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial\" lang=\"ES\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:23.75pt;margin-bottom:\r\n0cm;margin-left:16.8pt;margin-bottom:.0001pt;text-align:justify;text-indent:\r\n-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;\" lang=\"ES\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\">Decreto-Ley\r\nNo.304</span></b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;mso-bidi-font-weight:bold\" lang=\"ES\">, </span><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\">“De la Contratación\r\n Económica”, <span style=\"mso-bidi-font-weight:bold\">emitido\r\nen </span>fecha 1 de noviembre de 2012, por el Consejo de Estado.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:23.75pt;margin-bottom:\r\n0cm;margin-left:16.8pt;margin-bottom:.0001pt;text-align:justify;text-indent:\r\n-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;\" lang=\"ES\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\">Decreto\r\nNo. 310</span></b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;mso-bidi-font-weight:bold\" lang=\"ES\"> “De los tipos de\r\nContratos”, emitido en </span><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES\">fecha 17 de diciembre de 2012, por el<span style=\"mso-spacerun:yes\">&nbsp;&nbsp; </span>Consejo de Ministros.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:23.75pt;margin-bottom:\r\n0cm;margin-left:16.8pt;margin-bottom:.0001pt;text-align:justify;text-indent:\r\n-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;\" lang=\"ES\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\n mso-bidi-font-family:Arial\" lang=\"ES\">La <b style=\"mso-bidi-font-weight:normal\">Instrucción\r\n No.</b></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\">\r\n215</span></b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES\"> del Consejo de Gobierno del Tribunal Supremo\r\nPopular, de fecha 13 de abril de 2012.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center\" align=\"center\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">PRETENSIONES:</span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-pagination:none;mso-layout-grid-align:none;\r\ntext-autospace:none\"><b><u><span style=\"font-size:8.0pt;\r\nfont-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;color:red;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">UNICA:</span></b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\"> Que proceda a _________________________\r\nreflejados en el hecho TERCERO de la presente reclamación, disponiendo de un\r\ntermino de 30 días naturales contados a partir de la contestación de la\r\npresente para ______________________ o en el termino que definan las partes de\r\ncomún acuerdo y que quedaran reflejado en Suplemento que se firmara a tal\r\nefecto. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-pagination:none;mso-layout-grid-align:none;\r\ntext-autospace:none\"><b><u><span style=\"font-size:8.0pt;\r\nfont-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;color:red;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\"><span style=\"text-decoration:none\">&nbsp;</span></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;mso-pagination:none;\r\nmso-layout-grid-align:none;text-autospace:none\" align=\"center\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">POR TANTO</span></u></b><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">:</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-pagination:none;mso-layout-grid-align:none;\r\ntext-autospace:none\"><span style=\"font-size:8.0pt;font-family:\r\n&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;color:red;mso-ansi-language:\r\nES-TRAD\" lang=\"ES-TRAD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify\"><b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">A Usted</span></u></b><u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\"> <b>SOLICITO</b></span></u><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">:<span style=\"color:red\"> </span>Que se sirva tener\r\npor presentada dicha <b style=\"mso-bidi-font-weight:normal\"><u>Reclamación</u></b>\r\ndentro del término establecido legalmente y proceda a __________________ reflejado\r\nen el hecho TERCERO de la presente reclamación, disponiendo de un termino de 30\r\ndías naturales contados a partir de la contestación de la presente para _____________________\r\no en<span style=\"mso-spacerun:yes\">&nbsp; </span>caso contrario en el termino que\r\ndefinan las partes de común acuerdo y que quedaran reflejado en Suplemento que\r\nse firmara a tal efecto, de lo contrario decursado el término antes descrito, se\r\nprocederá a la facturación y cobro de la sanción pecuniaria pactada en el\r\ncontrato.</span><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\" lang=\"ES-TRAD\"> </span><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">Apercibiéndole que posee\r\nun término de <b style=\"mso-bidi-font-weight:normal\"><u>diez días hábiles</u></b>\r\npara examinar la presente y dar respuesta, y de no recibirla entenderemos por\r\nrechazada la misma, quedando expedita la vía para acudir a Sala de lo Económico\r\ndel Tribunal Provincial Popular que corresponda.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify;mso-pagination:\r\nnone;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-size:8.0pt;font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:\r\nArial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:-6.8pt;text-align:justify;line-height:\r\n115%\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;mso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\">En espera de su\r\nrespuesta, le saluda cordialmente,</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify;mso-pagination:\r\nnone;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\ncolor:red\" lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-right:16.7pt;text-align:justify;mso-pagination:\r\nnone;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\ncolor:red\" lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;mso-pagination:none;\r\nmso-layout-grid-align:none;text-autospace:none\" align=\"center\"><span style=\"font-family:\r\n&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial\" lang=\"ES\">_________________________</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center;mso-pagination:none;\r\nmso-layout-grid-align:none;text-autospace:none\" align=\"center\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif;mso-bidi-font-family:Arial;\r\nmso-ansi-language:ES-TRAD\" lang=\"ES-TRAD\"><u><input size=\"23\" restriction=\"\