pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:11,0000pt;\">1.&nbsp;OBJETO DEL CONTRATO</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">1.1.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Por el presente EL </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">viene obligado a realizar a solicitud del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">los S</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">ervicios de<u><input size=\"19\" restriction=\"\" value=\"Objeto del contrato\" id=\"comment\" mapping=\"Event;comment\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> que se describen en el </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">Anexo No.1 </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">contentivo de la oferta comercial</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">;</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;por su parte el</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">viene obligado al pago de los servicios en los términos y condiciones que más adelante se dirán.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">2.&nbsp;OBLIGACIONES DEL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.1.&nbsp;Entregar toda la información técnica necesaria para facilitar el servicio pactado según lo que se solicite revisar, teclear, imprimir, encuadernar y completar.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.2.&nbsp;Coordinar la realización de encuentros de trabajo para la valoración del cumplimiento del cronograma de ejecución y cualquier otro aspecto relacionado con el cumplimiento del objeto de este contrato. De dichos encuentros, quedarán recogidas actuaciones y acuerdos por escrito firmados por ambas partes que formarán parte Anexa al presente contrato.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.5 &nbsp;Firmar Acta de Conformidad con el servicio pactado el que podrá elaborarse parcial y/o al finalizar.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.6.&nbsp;Garantizar, en el caso que ocurra, la participación del personal designado en la capacitación para utilizar herramientas de trabajo que </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;le presente y sea aceptada por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;su instalación en las estaciones de trabajo de este último.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.7.&nbsp;</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;viene obligado a garantizar que dispone de los fondos financieros y materiales necesarios y/o aprobados por su Organismo Rector para la ejecución de los servicios contratados.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.8.&nbsp;Brindar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;el apoyo necesario para el cumplimiento adecuado de los objetivos pactados, prestando su colaboración y las facilidades requeridas en ocasión de la ejecución del servicio.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.9.&nbsp;Designar al personal que servirá de guía y coordinador del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">, cuando los trabajos se ejecuten en sus instalaciones.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.10.&nbsp;Mantener informado al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;sobre cualquier cambio que se produzca en la identificación de la &nbsp;entidad, los representantes facultados a tenor de la cláusula anterior, así como cual otro elemento que tenga incidencia en la validez y ejecución del contrato, con sus efectos legales pertinentes.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.11.&nbsp;Verificar que el servicio cumpla con los requisitos mínimos exigidos en las prácticas comerciales y/o acordadas por las partes.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.12.&nbsp;Informar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;con un término no superior a las 72 horas antes del vencimiento del término pactado para la recepción de un servicio al amparo del presente contrato, sobre cualquier impedimento que tenga y que no se encuentre comprendido dentro de las eximentes de responsabilidad.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">2.13.&nbsp;Aprobar la factura presentada y efectuar el pago a </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;por su servicio, según el precio y &nbsp;condiciones pactadas. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:12,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">3.&nbsp;OBLIGACIONES DE EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">3.1.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">Prestar el servicio convenido cumpliendo los parámetros de calidad y Cronograma de Ejecución (si se conviene) con </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">3.2.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Observar las normas internas relacionadas con Seguridad y Protección, durante su permanencia en el local perteneciente a </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">en caso que el trabajo a realizar así lo requiera.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">3.3.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Cuidar los bienes pertenecientes a</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;que con motivo de la ejecución del presente contrato sean puestos a su disposición. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">3.4.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Informar a EL</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">de cualquier variación que tenga sobre su Licencia o Patente mientras dure el período de vigencia del contrato, así como sobre las variaciones de los Listado de Precios, la que será aportada a solicitud del mismo</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">cada vez que este lo considere oportuno; de igual manera sobre los probables cambios en cuanto a teléfonos o direcciones habilitadas para la comunicación entre ambos.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">3.5.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Informar a</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;con un término no superior a las 72 horas antes del vencimiento del término pactado para la ejecución de un trabajo al amparo del presente contrato, sobre cualquier impedimento que tenga para ejecutar el servicio pactado que no se encuentre comprendido dentro de las eximentes de responsabilidad.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">3.6.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Responder por las consecuencias que se deduzcan para terceros, de las omisiones, errores, métodos inadecuados, conclusiones incorrectas u otras acciones similares en la ejecución del contrato. Dicha indemnización consistirá en el pago a </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">del importe de los gastos en que este incurra al resarcir a los terceros afectados.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">3.7.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Presentar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;el informe final y entregar la documentación utilizada para el servicio pactado impreso y en formato digital.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;t