"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Dark List Accent 6\" ></w:LsdException>\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Shading Accent 6\" ></w:LsdException>\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful List Accent 6\" ></w:LsdException>\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Grid Accent 6\" ></w:LsdException>\n</w:LatentStyles></xml><![endif]--></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:36,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l2 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">4.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">VALOR, INSTRUMENTO Y FORMA DE PAGO</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo2;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:Calibri;font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">4.1<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">El valor total del presente Contrato será el resultante de la sumatoria de las facturas presentada y aceptadas por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;en el término de vigencia del mismo.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span><span style=\"font-family:Arial;mso-fareast-font-family:Calibri;font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">4.2<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;utilizará para el pago de los servicios pactados&nbsp; los instrumentos de pago <u><input size=\"20\" restriction=\"spaceseparatedsingleline\" value=\"Instrumentos de pago\" id=\"4a2c80d86be973935f621af597cdbf86\" mapping=\"Paymentinstruments:decode[name],;\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> títulos vigentes; preferiblemente&nbsp; a la cuenta del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">. <br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo2;\" align=\"justify\"><br><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">5.&nbsp;PLAZOS</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">5.1.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Ambas partes acuerdan que el servicio pactado se realizará en un solo plazo de inicio a fin, atendiendo a la complejidad de las acciones. El término de ejecución del servicio se computará en días laborales (lunes a viernes), las horas de servicio diario se materializarán por acuerdo de las partes.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">5.2.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">De ser necesario plazos adicionales, se acordarán otros, los que quedarán plasmados en suplementos que formarán parte del presente contrato con los requerimientos para su ejecución.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.&nbsp;CALIDAD y GARANTÍA</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.1 EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;brindará el servicio convenido con la calidad, profesionalidad y estricta observancia de la legislación que regula la materia del servicio acordado de acuerdo a las características de este, lo que quedará reflejado en el Acta de Conformidad que se emita al respecto.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.2</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;La calidad de los servicios quedarán regidas por lo establecido en las regulaciones vigentes en el país para este tipo de servicio:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;Normas del Sistema Nacional de Contabilidad, así como la resolución 60/2011 de la Controlaría General de la República</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;y otras afines; así como las solicitadas por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE, </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">previo acuerdo entre ambas Partes</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">. </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">De no existir normas o exigencias de calidad específicas </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;prestará dicho servicio sobre la base una calidad razonable, normalmente aceptada en la práctica comercial</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">.</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.3</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;La garantía que</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;ofrece a</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, cuando proceda, es la convenida en el momento de la entrega del servicio, fijada en el acta de conformidad, sin perjuicios de lo relacionado con los vicios ocultos que pudieran aparecer posteriormente en el término que establece la ley</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">.</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.4 </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Cuando en la prestación del servicio existan defectos, insuficiencias técnicas, errores materiales, omisiones e infracciones de preceptos legales o reglamentarios, acaecidos en la realización del servicio o a consecuencia de este, imputables al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">; las Partes pueden acordar un plazo para la subsanación o la resolución del contrato. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">7.&nbsp;SEGURIDAD Y SALUD DEL TRABAJO</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;7.1.&nbsp;</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">tomará cuantas precauciones y medidas de protección sean necesarias a favor de preservar la integridad física del personal del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, mientras estos realicen trabajos en cualquier sitio de su entidad en función del servicio contratado. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">7.2.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">El personal del</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;PRESTADOR </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">para realizar el servicio pactado se obliga a cumplir las medidas de protección establecidas en la entidad del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, asumiendo la responsabilidad en caso de violación de aquellas sobre las cuales fueron instruidos.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">8.&nbsp;RÉGIMEN JURÍDICO:</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"NewStyle18\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">8.1 El presente Contrato se rige por:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o&nbsp;Decreto Ley 304 “De La Contratación Económica, de fecha 1ro de noviembre de 2012, del Consejo de Estado.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o&nbsp;Decreto 310 “De Los Tipos de Contratos”, de fecha 17 de diciembre de 2012, del Consejo de Ministros.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o&nbsp;Ley 7 “Ley de procedimiento Civil, Administrativo, Laboral y Económico” de fecha 19 de agosto de 1977.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o&nbsp;Ley 59 “Código Civil” de fecha 16 de julio de 1987, de manera supletoria.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o&nbsp;Resolución 101/11 “Normas Bancarias para los Cobros y Pagos” de fecha 18 de noviembre del 2011, del Banco Central de Cuba.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;color:rgb(0,0,0);font-size:10,0000pt;\">Resolución 11/2018 del MTSS Reglamento del Ejercicio del Trabajo por Cuenta Propia.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;color:rgb(255,0,0);font-size:10,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;color:rgb(0,0,0);font-size:10,0000pt;\">Resolución 12 “Alcance de las actividades del Trabajo por cuenta propia del Ministerio de Trabajo y Seguridad Social de fecha 29 de junio del 2018.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-left:28,3500pt;text-indent:-7,0500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">o&nbsp;Instrucción 7 “Indicaciones a las entidades estatales para la contratación de los productos y servicios de los Trabajadores por cuenta propia” de fecha 18 de noviembre del 2011 del Ministerio de Economía y Planificación.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">9.&nbsp;CAUSAS EXIMENTES DE RESPONSABILIDAD.</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">9.1.&nbsp;Las Partes no serán responsables por el incumplimiento o cumplimiento inadecuado de sus obligaciones contractuales cuando las mismas resulten imposibles de satisfacer debido a hechos imprevisibles o si previsibles inevitables que, ajenos a la voluntad y actuación de las Partes, surjan con posterioridad a la entrada en vigor del presente Contrato.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">9.2.&nbsp;La Parte que invoque la causa eximente de responsabilidad, notificará y probará a la otra Parte por escrito y de inmediato, su naturaleza, comienzo y duración y las posibles consecuencias en el cumplimiento del Contrato, así como oportunamente su terminación, acompañando las certificaciones que fueren necesarias, expedidas al efecto por la Cámara de Comercio de Cuba y/o certificadas por la autoridad competente en caso de tratarse de disposiciones del Poder Público , en el término de treinta (72horas) días contados a partir de la fecha que el mismo se produjo. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">9.3.&nbsp;Si la causa eximente de responsabilidad se extendiere por más de dos (2) meses, las Partes se reunirán y adoptarán las decisiones más convenientes para ambas.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">10.&nbsp;CONFIDENCIALIDAD Y PROPIEDAD INTELECTUAL</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">10.1.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Las partes acuerdan mantener la confidencialidad necesaria sobre las tecnologías, secretos comerciales e información general que se declaren por cualquier vía concernientes al presente Contrato y las que se generen en virtud del servicio prestado, así como las modalidades de la Propiedad Intelectual que ambas impliquen en los negocios ejecutados.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">10.2.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Durante la vigencia del presente contrato y en caso de que una de las partes conozca sobre la divulgación de alguna información limitada brindada para el mejor cumplimiento del presente, la parte afectada se reserva el derecho de presentar demanda contra aquel por el monto resultante del daño causado como consecuencia de ese actuar.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">10.3.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Las conclusiones y dictámenes derivados del servicio o servicios solicitados por el Cliente, no podrán &nbsp;&nbsp;ser divulgados a terceros, aunque la información contenida en los mismos sea de dominio público.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">10.4.&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Las partes se obligan a hacer aplicar esta disposición respecto a sus ejecutivos, funcionarios y trabajadores implicados en el Contrato, así como otras personas naturales y jurídicas que por razones de trabajo tengan acceso a las mismas.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">10.5.&nbsp;</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">respetará íntegramente todos los derechos sobre las modalidades de la propiedad intelectual que ostente </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">11.&nbsp;DE LAS RESPONSABILIDADES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">11.1 Las partes serán responsables por los daños y perjuicios que puedan causar durante el cumplimiento de las obligaciones pactadas, lo que se deberá demostrarse de forma documental, debidamente acreditada.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:14,2000pt;text-indent:-14,2000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo3;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">12<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">PENALIDADES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">:</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">12.1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;Si </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">El PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">&nbsp;habiéndose obligado no ejecutara el servicio en el plazo pactado, se aplicará una penalización por concepto de sanción pecuniaria del 0.03 % del valor del servicio por cada día de demora, durante los primeros treinta días, 0.05 %por cada día de demora durante los treinta días siguientes y el 0.8 % por cada día de demora por más de sesenta días.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoBodyText2\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">12.2 </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">Si transcurridos los términos establecidos en el presente contrato </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">no efectúa el pago debido, se considerará a todos los efectos legales que ha incurrido en mora, por lo que vendrá obligado a </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">abonar</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">&nbsp;una penalidad por mora ascendente a un 2% del valor total de la factura adeudada cuyo cálculo se realizará de manera anual y a partir del día hábil siguiente al vencimiento del término para el pago.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">12.3 La forma de documentar la obligación de pago por concepto de mora u otra penalidad en este acto pactada será la factura comercial, la que será pagadera en los treinta días posteriores a la fecha en que es recibida por la parte afectada. </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">LAS PARTES </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">serán responsables con reflejar en facturas independientes los recargos que procedan, así como garantizar el pago íntegro de lo que a cada cual le corresponde.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-right:0,8000pt;margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-right:0,8500pt;margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\">13. AVISO</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"NewStyle16\" style=\"margin-right:0,8500pt;margin-bottom:0,0000pt;margin-left:21,3000pt;mso-add-space:auto;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">13.1 Ante la eventual posibilidad de incumplimientos en la ejecución de lo pactado en el presente contrato las partes comunicaran el posible hecho con un término de treinta (30) días de antelación, informando las causas que motivan dicha proposición. La parte que reciba la comunicación deberá dar respuesta en un término de quince (15) días y transcurrido este plazo sin recibir respuesta, se considerará aceptada la proposición. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"margin-right:0,8500pt;margin-bottom:0,0000pt;margin-left:21,3000pt;mso-add-space:auto;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\">13.2 El suplemento correspondiente se otorgará dentro de los quince (15) días siguientes a la aceptación expresa o tácita de la proposición. En caso de existir problemas con la obtención de la materia prima para la ejecución de las producciones se avisará al Cliente con un término de 60 días de antelación, en su caso se firmará Suplemento entre ambas partes modificando los cronogramas de entrega, o se considerará la posibilidad de resolución del contrato de no tener solución para la ejecución de las producciones.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:Calibri;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><br><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">1</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">4 </span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">RECLAMACIONES Y LITIGIOS</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">4</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.1.&nbsp;Por el servicio pactado, </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, independientemente de haber firmado el Acta de conformidad con los servicios pactados, podrá establecer dentro de los siguientes quince (15) días de haber firmado el Acta de Conformidad de los servicios pactados reclamación al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, debiendo demostrar el objeto de reclamación, lo incumplido, pretensiones, cuantía y cuanta información sea necesaria para demostrar dicho incumplimiento, la reclamación no poseerá validez si le falta alguno de los elementos expuestos en la presente cláusula.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">4</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.2.&nbsp;Las discrepancias que se susciten, sobre la ejecución o interpretación del presente Contrato, serán &nbsp;&nbsp;resueltas entre las partes mediante negociaciones amigables y actuando de buena fe.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">4</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.3.&nbsp;Las partes podrán reclamarse mutuamente el incumplimiento de las obligaciones pactadas. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">4</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.4.&nbsp;Las reclamaciones se harán por escrito y dirigida al domicilio legal de la parte incumplidora, directamente o mediante correo certificado, en un término de treinta (30) días siguientes a detectarse el incumplimiento. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">4</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.5.&nbsp;Las reclamaciones recibidas deberán ser contestada por la contraparte en el término de quince (15) días hábiles contados a partir de su notificación. De no ser contestada se entenderá como rechazada la misma.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">4</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.6.&nbsp;De no llegar a un acuerdo entre las partes será sometido a la Sala de lo Económico del Tribunal Popular provincial del domicilio del demandado. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">1</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">5</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">&nbsp;VIGENCIA Y TERMINACIÓN DEL CONTRATO.</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">5</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">.1&nbsp;El presente </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">Contrato </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">entrará en vigor a partir del momento de su firma, y mantendrá plena vigencia hasta el cumplimiento total de las obligaciones, </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">pudiendo ser prorrogado mediante suplemento debidamente firmado por ambas partes.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">5</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">.2&nbsp;Son causas de resolución del Contrato: </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-14,1500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">a)&nbsp;Imposibilidad transitoria o permanente de cumplir los servicios pactados, por causas no imputables al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;del servicio, quedando al arbitrio del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;la concesión de un nuevo plazo o la resolución del contrato. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-14,1500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">b)&nbsp;Imposibilidad de cumplir los servicios pactados por causas imputables al prestador del servicio. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">En ambos casos </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;del servicio debe comunicar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">las circunstancias que determinan la imposibilidad de su cumplimiento desde el momento en que estas sobrevengan, sin perjuicio de la responsabilidad en que incurre por el incumplimiento.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">5</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.3&nbsp;Para dar por terminado el contrato, la parte interesada comunicara a la otra con 15 días de antelación su intención de cesar su vínculo contractual, exponiendo la causa que lo motivan. &nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">5</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.4&nbsp;La terminación del presente Contrato será sin perjuicio de cualquier obligación o derecho que cualquiera de las Partes tenga antes de dicha terminación y no afectará ninguna de sus disposiciones. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">5</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.5&nbsp;El Contrato permanecerá vigente hasta concluir los trabajos en ejecución, no asumiéndose nuevas obligaciones.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">5</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.6&nbsp;El presente Contrato podrá ser modificado por acuerdo expreso y escrito de las partes, </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">lo que quedará </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">refrendado en suplemento.</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">1</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;OTRAS DISPOSICIONES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">6</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.1&nbsp;Las partes acuerdan mantener el intercambio de información y asesoramiento mutuo para el cumplimiento exitoso del presente Contrato, obrando de buena fe durante todo el desarrollo del mismo.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">6</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.2&nbsp;Ninguna de las partes podrá ceder a un tercero sus derechos u obligaciones resultantes del presente Contrato sin el consentimiento expreso y por escrito de la otra parte. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">6</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.3&nbsp;Los anexos y suplementos que se le incorporen al presente Contrato y a los que de conformidad con este se concierten en lo sucesivo, serán considerados partes del mismo y entrarán en vigor de acuerdo con las condiciones que en los mismos se establezcan para ello. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">6</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.4&nbsp;El presente contrato y la documentación del mismo será conservada por las partes concertantes, por cinco (5) años, con vistas a las supervisiones y controles que resulten.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">6</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.5&nbsp;Si durante la vigencia del presente Contrato y teniendo en cuenta la amplitud que abarca la actividad que ejerce </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">para este Contrato, se decide por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;otro servicio relativo al mismo, una vez negociado lo que se pretende, se emitirá suplemento en el que se reflejen todas las actividades a realizar por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;con las obligaciones comunes a ambas partes, manteniendo el resto de las cláusulas que no se menciones en esos Suplementos su vigencia y aplicación.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Y para constancia de lo acordado, los comparecientes firman el presente Contrato a dos ejemplares, a un solo tenor y con la misma fuerza legal, en la Ciudad de Holguín con fecha ______ de ____________________ &nbsp;del __________.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:11,0000pt;\">&nbsp;</span></p><table class=\"MsoNormalTable\" style=\"border-collapse:collapse;width:516,0000pt;margin-left:4,6500pt;mso-table-layout-alt:fixed;mso-padding-alt:0,7500pt 0,7500pt 0,7500pt 0,7500pt ;\"><tbody><tr><td style=\"width:126,7500pt;padding:0,7500pt 0,7500pt 0,7500pt 0,7500pt ;\" width=\"169\" valign=\"top\"><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:center;\" align=\"center\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:11,0000pt;\">POR EL PRESTADOR</span></b><span style