t-family:\'Arial Unicode MS\';mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">DE OTRA PARTE:&nbsp;</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"><u><input size=\"43\" restriction=\"\" value=\"Denominación/Nombre y Apellidos del cliente\" id=\"628d28fee6fe686d71514c03b774d59d\" mapping=\"Client;name\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, ciudadano cubano, con domicilio legal en <u><input size=\"21\" restriction=\"\" value=\"Dirección del cliente\" id=\"9a7fd8bec8a9f966f4236a61b2681cb3\" mapping=\"Client;address\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u>, con identidad permanente número <u><input size=\"15\" restriction=\"\" value=\"NIT del cliente\" id=\"e9de6b1a2488bd471e6de0c357172429\" mapping=\"Client;nit\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> con autorización para ejercer el Trabajo por Cuenta Propia de la Dirección de Trabajo municipal de Holguín &nbsp;No<u><input size=\"23\" restriction=\"commaseparatedsingleline\" value=\"Actividades del cliente\" id=\"3adbc53345ef5502c087f2e3e29ad7cd\" mapping=\"Client:decode[name,value],activities;profile\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> con Cuenta Bancaria en pesos cubanos (CUP) No. ______________, en el Banco ____________ sucursal _____, cito en ______________, Municipio________, Provincia _________, teléfono ___________ y ___________, correo electrónico: ________________, que en lo adelante se denominará EL CLIENTE.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;</span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">1. OBJETO DEL CONTRATO:</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\"></span></b></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:Arial;font-size:7,0000pt;\">1.1. </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">Por el presente </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;viene obligado a realizar a solicitud del </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;los S</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:Arial;font-size:7,0000pt;\">ervicios de </span><u><input size=\"19\" restriction=\"\" value=\"Objeto del contrato\" id=\"comment\" mapping=\"Event;comment\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:Arial;font-size:7,0000pt;\"> y en contraposición </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">&nbsp;CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;viene obligado a pagar por la prestación del servicio antes descrito.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;</span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">2. OBLIGACIONES DE EL CLIENTE</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">2.1 Informar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;con un término no superior a las 72 horas antes del vencimiento del término pactado para la recepción del servicio al amparo del presente contrato, sobre cualquier impedimento que tenga para cumplir sus obligaciones y que no se encuentre comprendido dentro de las eximentes de responsabilidad.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">2.2 Guardar por 5 años los comprobantes de cobro, las copias de Declaraciones Juradas, los registros de Ingresos y gastos y vector fiscal.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">2.3 Depositar el efectivo al </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri