ri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;que con motivo de la ejecución del presente contrato sean puestos a su disposición. </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">3.4 Informar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;de cualquier variación que tenga sobre su Licencia o Patente, domicilio legal, precio de los servicios u otros mientras dure el período de vigencia del presente contrato.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">3.5 Informar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;con un término no superior a las setenta y dos (72) horas antes del vencimiento del término pactado para la ejecución de un trabajo al amparo del presente c