-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">4.1 El valor total del presente Contrato será el resultante de la sumatoria de los pagos del servicio aceptadas por </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;en el término de vigencia del mismo.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">4.2</span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">&nbsp;EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;utilizará para el pago de los servicios pactados la transferencia bancaria y/o pago en efectivo en el domicilio del </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">4.3 las transferencias bancarias se realizarán antes de los veinte (20) días del cumplimiento del ejercicio fiscal.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">4.4 </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">EL pago del servicio cuando el CLIENTE tiene un régimen general de</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;tributacion &nbsp;y solicita &nbsp;contabilidad simplificada, mas deposito en &nbsp;cuenta fiscal 150.00 pesos mn, cuando &nbsp;es &nbsp;general y solicita &nbsp;llenado &nbsp;de registro 50.00 pesos mn, cuando &nbsp;solo &nbsp;deposite &nbsp;los &nbsp;tributos 20.00 pesos mn.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;</span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">5. PLAZOS:</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\"></span></b></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">5.1 Ambas partes acuerdan que el servicio pactado se realizará en unos doce (12) plazos de inicio a fin, atendiendo a la complejidad de las acciones. El término de ejecución del servicio se computará en días laborales (lunes a viernes), las horas de servicio diario se establecen entre 8:30 am a 2:45 pm.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">5.2 De ser necesario plazos adicionales, se acordarán otros, los que quedarán plasmados en suplementos que formarán parte del presente contrato con los requerimientos para su ejecución.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">&nbsp;</span></b></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">6. CALIDAD y GARANTÍA:</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\"></span></b></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">6.1 </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;brindará el servicio convenido con la calidad, profesionalidad y estricta observancia de la legislación que regula la materia del servicio acordado de acuerdo a las características de este.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;</span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">7. RÉGIMEN JURÍDICO:</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\"></span></b></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">7.1 El presente Contrato se rige por:</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">Ley 113 Ley Tributaria sobre los impuestos, tasa y aportes; Decreto Ley 304 “De La Contratación Económica, de fecha 1ro de noviembre de 2012, del Consejo de Estado; Decreto 310 “De Los Tipos de Contratos”, de fecha 17 de diciembre de 2012, del Consejo de Ministros; Ley 7 “Ley de procedimiento Civil, Administrativo, Laboral y Económico” de fecha 19 de agosto de 1977; Decreto Ley 308 del Consejo de Ministros “Reglamento de las Normas Generales y los Procedimientos Tributarios; Ley 59 “Código Civil” de fecha 16 de julio de 1987, de manera supletoria; Resolución 101/11 “Normas Bancarias para los Cobros y Pagos” de fecha 18 de noviembre del 2011, del Banco Central de Cuba; </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;color:rgb(0,0,0);font-size:7,0000pt;\">Resolución 11/2018 del MTSS Reglamento del Ejercicio del Trabajo por Cuenta Propia; Resolución 12 “Alcance de las actividades del Trabajo por cuenta propia del Ministerio de Trabajo y Seguridad Social de fecha 29 de junio del 2018; </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">Instrucción 7 “Indicaciones a las entidades estatales para la contratación de los productos y servicios de los Trabajadores por cuenta propia” de fecha 18 de noviembre del 2011 del Ministerio de Economía y Planificación.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;</span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">9. CAUSAS EXIMENTES DE RESPONSABILIDAD.</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\"></span></b></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">9.1. Las Partes no serán responsables por el incumplimiento o cumplimiento inadecuado de sus obligaciones contractuales cuando las mismas resulten imposibles de satisfacer debido a hechos imprevisibles o si previsibles inevitables que, ajenos a la voluntad y actuación de las Partes, surjan con posterioridad a la entrada en vigor del presente Contrato.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">8 RECLAMACIONES Y LITIGIOS</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">8.1 Por el servicio pactado, </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">, independientemente de haber firmado el Acta de conformidad con los servicios pactados, podrá establecer dentro de los siguientes quince (15) días de haber firmado el Acta de Conformidad de los servicios pactados reclamación al </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">, debiendo demostrar el objeto de reclamación, lo incumplido, pretensiones, cuantía y cuanta información sea necesaria para demostrar dicho incumplimiento, la reclamación no poseerá validez si le falta alguno de los elementos expuestos en la presente cláusula.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">8.2 Las discrepancias que se susciten, sobre la ejecución o interpretación del presente Contrato, serán &nbsp;&nbsp;resueltas entre las partes mediante negociaciones amigables y actuando de buena fe.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">8.3 Las partes podrán reclamarse mutuamente el incumplimiento de las obligaciones pactadas. </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">8.4 Las reclamaciones se harán por escrito y dirigida al domicilio legal de la parte incumplidora, directamente o mediante correo certificado, en un término de treinta (30) días siguientes a detectarse el incumplimiento. </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">8.5 Las reclamaciones recibidas deberán ser contestada por la contraparte en el término de quince (15) días hábiles contados a partir de su notificación. De no ser contestada se entenderá como rechazada la misma.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">8.6 De no llegar a un acuerdo entre las partes será sometido a la Sala de lo Económico del Tribunal Popular provincial del domicilio del demandado. </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;</span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">9. OTRAS DISPOSICIONES:</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\"></span></b></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">9.1 Las partes acuerdan mantener el intercambio de información y asesoramiento mutuo para el cumplimiento exitoso del presente Contrato, obrando de buena fe durante todo el desarrollo del mismo.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">9.2 Ninguna de las partes podrá ceder a un tercero sus derechos u obligaciones resultantes del presente Contrato sin el consentimiento expreso y por escrito de la otra parte. </span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">9.4 El presente contrato y la documentación del mismo será conservada por las partes concertantes, por cinco (5) años, con vistas a las supervisiones y controles que resulten.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">9.5 Si durante la vigencia del presente Contrato y teniendo en cuenta la amplitud que abarca la actividad que ejerce </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL PRESTADOR </span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">para este Contrato, se decide por </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;otro servicio relativo al mismo, una vez negociado lo que se pretende, se emitirá suplemento en el que se reflejen todas las actividades a realizar por </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;con las obligaciones comunes a ambas partes, manteniendo el resto de las cláusulas que no se menciones en esos Suplementos su vigencia y aplicación.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">9.6 </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;no se responsabiliza con los incumplimientos que tenga </span><b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-weight:bold;font-size:7,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;en cuanto a las obligaciones establecidas en el presente Contrato.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\"></span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:\'Arial Narrow\';mso-fareast-font-family:Calibri;mso-bidi-font-family:Arial;font-size:7,0000pt;\">Y para constancia de lo acordado, los comparecientes firman el presente Contrato a dos ejemplares, a un solo tenor y con la misma fuerza legal, en la Ciudad de Holguín con fecha ______ de ____________________ del __________.</span></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><br></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><br></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><br></p><p class=\"NewStyle16\" style=\"text-align:justify;text-justify:inter-ideograph;\" align=\"justify\">&nbsp;&nbsp;&