mily:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">;</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;por su parte el</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;viene obligado al pago de los servicios en los términos y condiciones que más adelante se dirán.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">OBLIGACIONES DEL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.1.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Seleccionar con una “X” en el </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">Anexo No.1</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;del presente Contrato la actividad específica que requiera del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.2.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Coordinar la realización de encuentros de trabajo para la valoración del cumplimiento del cronograma de ejecución y cualquier otro aspecto relacionado con el cumplimiento del objeto de este contrato. De dichos encuentros, quedarán recogidas actuaciones y acuerdos por escrito firmados por ambas partes que formarán parte Anexa al presente contrato.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.3.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Entregar el &nbsp;listado &nbsp;del personal en arial &nbsp;12 y &nbsp;mayúscula, el &nbsp;mismo &nbsp;es &nbsp;responsable &nbsp;de la &nbsp;ortografía.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.4.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Firmar Acta de Conformidad con el servicio pactado el que podrá elaborarse parcial y/o al finalizar.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.5.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">G</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">arantizar que dispone de los fondos financieros y materiales necesarios y/o &nbsp;aprobados &nbsp;por su Organismo Rector para la ejecución de los servicios contratados.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.6.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Brindar a &nbsp;</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;el apoyo necesario para el cumplimiento adecuado de los objetivos pactados, prestando &nbsp;su colaboración &nbsp;y las facilidades requeridas en &nbsp;ocasión de la ejecución del</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">servicio</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';color:rgb(255,0,0);font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.7.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Designar al personal que servirá de guía y coordinador del</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;PRESTADOR, </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">cuando los trabajos se ejecuten en sus instalaciones</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.8.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Mantener informado al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;sobre cualquier cambio que se produzca en la identificación de la entidad, los representantes facultados a tenor de la cláusula anterior, así como &nbsp;cual otro elemento &nbsp;que tenga incidencia en la validez y ejecución del contrato, con sus efectos legales pertinentes.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.9.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Verificar que el servicio &nbsp;cumpla &nbsp;con los requisitos &nbsp;mínimos exigidos en las prácticas comerciales y/o acordadas por LAS PARTES.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.10.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Informar al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;&nbsp;con un término no superior a las 72 horas &nbsp;antes del vencimiento del término pactado para la recepción de un servicio al amparo del &nbsp;presente contrato, &nbsp;sobre cualquier impedimento que tenga y que no se encuentre comprendido dentro de las eximentes de responsabilidad</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">2.11.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Aprobar la factura presentada y efectuar el pago al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;por su servicio, según el precio y condiciones pactadas.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">OBLIGACIONES DEL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.1.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Prestar el servicio convenido cumpliendo los parámetros de calidad y Cronograma de Ejecución (si se conviene) con </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.2.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Observar las normas internas relacionadas con Seguridad y Protección, durante su permanencia en el local perteneciente al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">en caso que el trabajo a realizar así lo requiera.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.3.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Cuidar los bienes pertenecientes al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;que con motivo de la ejecución del presente contrato sean puestos a su disposición. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.4.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Informar al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">de cualquier variación que tenga sobre su Licencia o Patente mientras dure el período de vigencia del contrato, así como</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;sobre las variaciones de los Listado de Precios, la que será aportada a solicitud del mismo</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">cada vez que este lo considere oportuno; de igual manera</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;sobre los probables cambios en cuanto a teléfonos o direcciones habilitadas para la comunicación entre ambos.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.5.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Informar al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;con un término no superior a las 72 horas antes del vencimiento del término pactado para la ejecución de un trabajo al amparo del presente contrato, sobre cualquier impedimento que tenga para ejecutar el servicio pactado que no se encuentre comprendido dentro de las eximentes de responsabilidad.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.6.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Responder por las consecuencias que se deduzcan para terceros, de las omisiones, errores, métodos inadecuados, conclusiones incorrectas u otras acciones similares en la ejecución del contrato. Dicha indemnización consistirá en el pago al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">del importe de los gastos en que este incurra al resarcir a los terceros afectados.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">3.7.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Presentar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;el informe final y entregar la documentación utilizada para el servicio pactado impreso y en formato digital.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">4.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">VALOR, INSTRUMENTO Y FORMA DE PAGO</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">4.1.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">El valor total del presente Contrato </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">es &nbsp;de ______________ que será la</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;sumatoria de las facturas presentada y aceptadas</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;en el término de vigencia del mismo</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">4.2.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;utilizará para el pago de los servicios pactados <u><input size=\"20\" restriction=\"spaceseparatedsingleline\" value=\"Instrumentos de pago\" id=\"4a2c80d86be973935f621af597cdbf86\" mapping=\"Paymentinstruments:decode[name],;\" disabled=\"disabled\" style=\"border:none; text-decoration:underline; text-align:center;\" type=\"text\"></u> a la cuenta del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">4.3.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">El pago se realizará por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;por </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">el </span><b><u><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;text-decoration:underline;text-underline:single;font-size:10,0000pt;\">15</span></u></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;%</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">previa</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">presentación de la factura</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;antes del comienzo del servicio </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">y el restante,</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;al culminar el servicio </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">con la aceptación por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;de la ejecución del mismo con la firma del </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">acta de conformidad</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">5.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PLAZOS</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">5.1.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">AMBAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;acuerdan que el servicio pactado se realizará en un solo plazo de inicio a fin, atendiendo a la complejidad de las acciones. El término de ejecución del servicio se computará en días laborales (lunes a viernes), las horas de servicio diario se materializarán por acuerdo de LAS PARTES.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">5.2.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">De ser necesario plazos adicionales, se acordarán otros, los que quedarán plasmados en suplementos que formarán parte del presente contrato con los requerimientos para su ejecución.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">6.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CALIDAD y GARANTIA</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.1 EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;brindará el servicio convenido con la calidad</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;y </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">profesionalidad </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">de</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;la materia del servicio acordado de acuerdo a las características de este,</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;con un plazo de 2 años de garantía,</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;lo que quedará reflejado en el Acta de Conformidad que se emita al respecto.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.2</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;La calidad de los servicios quedarán regidas por lo establecido en las regulaciones vigentes en el país para este tipo de servicio y las solicitadas por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE, </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">previo acuerdo entre </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">AMBAS PARTES. </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">p</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">reservara el diseño </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">e</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">entregado con</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">la </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">calidad específicas</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;sobre la base </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">de </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">una </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">excelente </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">calidad</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.3</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;La garantía que</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;ofrece al</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">es de Dos (2) años, siempre &nbsp;que no usen &nbsp;los solapines &nbsp;en &nbsp;lugares de productos químicos, combustibles o levanten la Mica</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">.</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">6.4 </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Cuando en la prestación del servicio existan defectos, insuficiencias técnicas, errores materiales, omisiones e infracciones de preceptos legales o reglamentarios, en la realización del servicio o a consecuencia de este, imputables al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">; </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">en término de </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">TRES (3)</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;meses posterior a la entrega &nbsp;</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">AMBAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;coordinaran </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">para la subsanación &nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">de los </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">defectos, insuficiencias técnicas</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;y </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">errores</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><a name=\"OLE_LINK4\"></a><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">7.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><a name=\"OLE_LINK3\">SEGURIDAD Y SALUD DEL TRABAJO</a></span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">7.1.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">tomará cuantas precauciones y medidas de protección sean necesarias a favor de preservar la integridad física del personal del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, mientras estos realicen trabajos en cualquier sitio de su entidad en función del servicio contratado. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">7.2.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">El personal del</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;PRESTADOR </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">para realizar el servicio pactado se obliga a cumplir las medidas de protección establecidas en la entidad del </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, asumiendo la responsabilidad en caso de violación de aquellas sobre las cuales fueron instruidos.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">8.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">RÉGIMEN JÚRIDICO</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">8.1 El presente Contrato se rige por:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Decreto Ley 304 “De La Contratación Económica, de fecha 1ro de noviembre de 2012, del Consejo de Estado.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Decreto 310 “De Los Tipos de Contratos”, de fecha 17 de diciembre de 2012, del Consejo de Ministros.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Ley 7 “Ley de procedimiento Civil, Administrativo, Laboral y Económico” de fecha 19 de agosto de 1977.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Ley 59 “Código Civil” de fecha 16 de julio de 1987, de manera supletoria.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Resolución 101/11 “Normas Bancarias para los Cobros y Pagos” de fecha 18 de noviembre del 2011, del Banco Central de Cuba.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';color:rgb(0,0,0);font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';color:rgb(0,0,0);font-size:10,0000pt;\">Resolución 11/2018 del MTSS Reglamento del Ejercicio del Trabajo por Cuenta Propia.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';color:rgb(0,0,0);font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';color:rgb(0,0,0);font-size:10,0000pt;\">Resolución 12 “Alcance de las actividades del Trabajo por cuenta propia del Ministerio de Trabajo y Seguridad Social de fecha 29 de junio del 2018.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';color:rgb(0,0,0);font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';color:rgb(0,0,0);font-size:10,0000pt;\">Resolución 127 del Presidente de la Asamblea Provincial del Poder Popular de Holguín sobre las formas de pago a los Trabajadores por Cuenta Propia.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle19\" style=\"margin-bottom:0,0000pt;margin-left:35,4500pt;text-indent:-15,2500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l1 level2 lfo3;\" align=\"justify\"><span style=\"font-family:\'Courier New\';mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">o<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Instrucción 7 “Indicaciones a las entidades estatales para la contratación de los productos y servicios de los Trabajadores por cuenta propia” de fecha 18 de noviembre del 2011 del Ministerio de Economía y Planificación.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">	</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">9.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">CAUSAS EXIMENTES DE RESPONSABILIDAD.</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">9.1.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;no serán responsables por el incumplimiento o cumplimiento inadecuado de sus obligaciones contractuales cuando las mismas resulten imposibles de satisfacer debido a hechos imprevisibles o si previsibles inevitables que, ajenos a la voluntad y actuación de </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">, surjan con posterioridad a la entrada en vigor del presente Contrato.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">9.2.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">La Parte que invoque la causa eximente de responsabilidad, notificará y probará a la otra Parte por escrito y de inmediato, su naturaleza, comienzo y duración y las posibles consecuencias en el cumplimiento del Contrato, así como oportunamente su terminación, acompañando las certificaciones que fueren necesarias, expedidas al efecto por la Cámara de Comercio de Cuba y/o certificadas por la autoridad competente en caso de tratarse de disposiciones del Poder Público , en el término de treinta (72horas) días contados a partir de la fecha que el mismo se produjo. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">9.3.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">Si la causa eximente de responsabilidad se extendiere por más de dos (2) meses, </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;se reunirán y adoptarán las decisiones más convenientes para ambas.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">10.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CONFIDENCIALIDAD Y PROPIEDAD INTELECTUAL</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,5000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">10.1.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;acuerdan mantener la confidencialidad necesaria sobre las tecnologías, secretos comerciales e información general que se declaren por cualquier vía concernientes al presente Contrato y las que se generen en virtud del servicio prestado, así como las modalidades de la Propiedad Intelectual que ambas impliquen en los negocios ejecutados.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,5000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">10.2.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Durante la vigencia del presente contrato y en caso de que una de </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;conozca sobre la divulgación de alguna información limitada brindada </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">para el mejor cumplimiento del presente,</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;la parte afectada se reserva el derecho de presentar demanda contra aquel por el monto resultante del daño causado como consecuencia de ese actuar.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,5000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">10.3.<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Las conclusiones y dictámenes derivados del servicio o servicios solicitados por el Cliente, no podrán &nbsp;&nbsp;ser divulgados a terceros, aunque la información contenida en los mismos sea de dominio público.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,5000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">10.4.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;se obligan a hacer aplicar esta disposición respecto a sus ejecutivos, funcionarios y trabajadores implicados en el Contrato, así como otras personas naturales y jurídicas que por razones de trabajo tengan acceso a las mismas.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,5000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level2 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';mso-bidi-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">10.5.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">respetará íntegramente todos los derechos sobre las modalidades de la propiedad intelectual que ostente </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">11.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">DE LAS RESPONSABILIDADES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">11.1 </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;serán responsables por los daños y perjuicios que puedan causar durante el cumplimiento de las obligaciones pactadas, lo que se deberá demostrarse de forma documental, debidamente acreditada.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">12.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PENALIDADES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">12.1</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;Si </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">El PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;habiéndose obligado no ejecutara el servicio en el plazo pactado, se aplicará una penalización por concepto de sanción pecuniaria del 0.03 % del valor del servicio por cada día de demora, durante los primeros treinta días, 0.05 %por cada día de demora durante los treinta días siguientes y el 0.8 % por cada día de demora por más de sesenta días.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoBodyText2\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">12.2 </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">Si transcurridos los términos establecidos en el presente contrato </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-weight:bold;font-size:10,0000pt;\">EL CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">no efectúa el pago debido, se considerará a todos los efectos legales que ha incurrido en mora, por lo que vendrá obligado a </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">abonar</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">&nbsp;una penalidad por mora ascendente a un 2% del valor total de la factura adeudada cuyo cálculo se realizará de manera anual y </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\">a partir del día hábil siguiente al vencimiento del término para el pago.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:SimSun;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">12</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">.3 La forma de documentar la obligación de pago por concepto de mora u otra penalidad en este acto pactada será la factura comercial, la que será pagadera en los treinta días posteriores a la fecha en que es recibida por la parte afectada. </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">serán responsables con reflejar en facturas independientes los recargos que procedan, así como garantizar el pago íntegro de lo que a cada cual le corresponde.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-right:0,8000pt;margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:11,0000pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-right:0,8500pt;margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">13. AVISO</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"NewStyle18\" style=\"margin-right:0,8500pt;margin-bottom:0,0000pt;margin-left:21,3000pt;mso-add-space:auto;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">13.1 Ante la eventual posibilidad de incumplimientos en la ejecución de lo pactado en el presente contrato las partes comunicaran el posible hecho con un término de treinta (30) días de antelación, informando las causas que motivan dicha proposición. La parte que reciba la comunicación deberá dar respuesta en un término de quince (15) días y transcurrido este plazo sin recibir respuesta, se considerará aceptada la proposición. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle18\" style=\"margin-right:0,8500pt;margin-bottom:0,0000pt;margin-left:21,3000pt;mso-add-space:auto;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">13.2 El suplemento correspondiente se otorgará dentro de los quince (15) días siguientes a la aceptación expresa o tácita de la proposición. En caso de existir problemas con la obtención de la materia prima para la ejecución de las producciones se avisará al Cliente con un término de 60 días de antelación, en su caso se firmará Suplemento entre ambas partes modificando los cronogramas de entrega, o se considerará la posibilidad de resolución del contrato de no tener solución para la ejecución de las producciones.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:21,3000pt;text-indent:-21,3000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:36,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l7 level1 lfo4;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">14.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">RECLAMACIONES Y LITIGIOS</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:18,7500pt;text-indent:-18,7500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l6 level2 lfo5;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">14.1<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Por el servicio pactado, </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, independientemente de haber firmado el Acta de conformidad con los servicios pactados, podrá establecer dentro de los siguientes quince (15) días de haber firmado el Acta de Conformidad de los servicios pactados reclamación al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, debiendo demostrar el objeto de reclamación, lo incumplido, pretensiones, cuantía y cuanta información sea necesaria para demostrar dicho incumplimiento, la reclamación no poseerá validez si le falta alguno de los elementos expuestos en la presente cláusula.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:18,7500pt;text-indent:-18,7500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l6 level2 lfo5;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">14.2<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Las discrepancias que se susciten, sobre la ejecución o interpretación del presente Contrato, serán &nbsp;&nbsp;resueltas entre </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;mediante negociaciones amigables y actuando de buena fe.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l6 level2 lfo5;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">14.3<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;podrán reclamarse mutuamente el incumplimiento de las obligaciones pactadas. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l6 level2 lfo5;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">14.4<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Las reclamaciones se harán por escrito y dirigida al domicilio legal de la parte incumplidora, directamente o mediante correo certificado, en un término de treinta (30) días siguientes a detectarse el incumplimiento. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l6 level2 lfo5;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">14.5<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Las reclamaciones recibidas deberán ser contestada por la contraparte en el término de quince (15) días hábiles contados a partir de su notificación. De no ser contestada se entenderá como rechazada la misma.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l6 level2 lfo5;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">14.6<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">De no llegar a un acuerdo entre </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;será sometido a la Sala de lo Económico del Tribunal Popular provincial del domicilio del demandado. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:36,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l7 level1 lfo4;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">15.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">VIGENCIA Y TERMINACIÓN DEL CONTRATO.</span></b><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,7500pt;text-indent:-18,7500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l3 level2 lfo6;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">15.1<span>&nbsp;</span></span></span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">El presente </span><b><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">Contrato </span></b><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">entrará en vigor a partir del momento de su firma, y mantendrá plena vigencia </span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">hasta el cumplimiento total de las obligaciones, </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">pudiendo ser prorrogado mediante suplemento debidamente firmado por ambas partes.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:18,7500pt;text-indent:-18,7500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l3 level2 lfo6;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">15.2<span>&nbsp;</span></span></span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">Son causas de resolución del Contrato: </span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"></span></p><p class=\"NewStyle17\" style=\"margin-left:42,5500pt;text-indent:-14,2000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l4 level4 lfo7;\" align=\"justify\"><span style=\"font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">a)<span>&nbsp;</span></span></span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">Imposibilidad transitoria o permanente de cumplir los servicios pactados, por causas no imputables al </span><b><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">PRESTADOR</span></b><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">&nbsp;del servicio, quedando al arbitrio del </span><b><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:bold;font-size:10,0000pt;\">CLIENTE</span></b><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">&nbsp;la concesión de un nuevo plazo o la resolución del contrato. </span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"></span></p><p class=\"NewStyle17\" style=\"margin-left:42,5500pt;text-indent:-14,2000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l4 level4 lfo7;\" align=\"justify\"><span style=\"font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">b)<span>&nbsp;</span></span></span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\">Imposibilidad de cumplir los servicios pactados por causas imputables al prestador del servicio. </span><span class=\"15\" style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">En ambos casos </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;del servicio debe comunicar al </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">CLIENTE </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">las circunstancias que determinan la imposibilidad de su cumplimiento desde el momento en que estas sobrevengan, sin perjuicio de la responsabilidad en que incurre por el incumplimiento.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l3 level2 lfo6;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">15.3<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Para dar por terminado el contrato, la parte interesada comunicara a la otra con 15 días de antelación su intención de cesar su vínculo contractual, exponiendo la causa que lo motivan. &nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l3 level2 lfo6;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">15.4<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">La terminación del presente Contrato será sin perjuicio de cualquier obligación o derecho que cualquiera de </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;tenga antes de dicha terminación y no afectará ninguna de sus disposiciones. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l3 level2 lfo6;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">15.5<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">El Contrato permanecerá vigente hasta concluir los trabajos en ejecución, no asumiéndose nuevas obligaciones.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l3 level2 lfo6;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-weight:normal;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">15.6<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">El presente Contrato podrá ser modificado por acuerdo expreso y escrito de </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">, </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Arial Unicode MS\';font-size:10,0000pt;\">lo que quedará </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">refrendado en suplemento.</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:4,0000pt;\">&nbsp;</span></b></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:36,0000pt;text-indent:-18,0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l7 level1 lfo4;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">16.<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">OTRAS DISPOSICIONES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">:</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"NewStyle20\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">16.1</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">&nbsp;LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;acuerdan mantener el intercambio de información y asesoramiento mutuo para el cumplimiento exitoso del presente Contrato, obrando de buena fe durante todo el desarrollo del mismo.</span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l5 level2 lfo8;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">16.2<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Ninguna de </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;podrá ceder a un tercero sus derechos u obligaciones resultantes del presente Contrato sin el consentimiento expreso y por escrito de la otra parte. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-28,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l5 level2 lfo8;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">16.3<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Los anexos y suplementos que se le incorporen al presente Contrato y a los que de conformidad con este se concierten en lo sucesivo, serán considerados partes del mismo y entrarán en vigor de acuerdo con las condiciones que en los mismos se establezcan para ello. </span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l5 level2 lfo8;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">16.4<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">El presente contrato y la documentación del mismo será conservada por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">LAS PARTES</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;concertantes, por cinco (5) años, con vistas a las supervisiones y controles que resulten.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l5 level2 lfo8;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">16.5<span>&nbsp;</span></span></span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Si durante la vigencia del presente Contrato y teniendo en cuenta la amplitud que abarca la actividad que ejerce </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR </span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">para este Contrato, se decide por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;otro servicio relativo al mismo, una vez negociado lo que se pretende, se emitirá suplemento en el que se reflejen todas las actividades a realizar por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;con las obligaciones comunes a ambas partes, manteniendo el resto de las cláusulas que no se menciones en esos Suplementos su vigencia y aplicación.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-indent:-25,3500pt;text-align:justify;text-justify:inter-ideograph;mso-list:l5 level2 lfo8;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\"><span style=\"mso-list:Ignore;\">16.6<span>&nbsp;</span></span></span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL CLIENTE</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;no podrá comercializar, ni entregar a otras personas jurídicas o naturales las herramientas que le sean instaladas por </span><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">EL PRESTADOR</span></b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;a fin de mejorar el servicio que se pacte entre LAS PARTES, cuidando siempre la propiedad intelectual de su autor.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;margin-left:28,3500pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:3,0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">Y para constancia de lo acordado, los comparecientes firman el presente Contrato a dos ejemplares, a un solo tenor y con la misma fuerza legal, en la Ciudad de Holguín con fecha ______ de ____________________ &nbsp;del __________.</span><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:5,0000pt;\">&nbsp;</span></p><table class=\"MsoNormalTable\" style=\"border-collapse:collapse;width:517,1500pt;mso-table-layout-alt:fixed;mso-padding-alt:0,0000pt 5,4000pt 0,0000pt 5,4000pt ;\"><tbody><tr style=\"height:4,0000pt;\"><td style=\"width:127,3500pt;padding:0,0000pt 5,4000pt 0,0000pt 5,4000pt ;border-top:1,0000pt solid windowtext;mso-border-top-alt:0,5000pt solid windowtext;\" width=\"169\" valign=\"top\"><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:center;\" align=\"center\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">POR EL PRESTADOR</span></b><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\"></span></p></td><td style=\"width:276,4000pt;padding:0,0000pt 5,4000pt 0,0000pt 5,4000pt ;\" width=\"368\" valign=\"top\"><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:justify;text-justify:inter-ideograph;\" align=\"justify\"><span style=\"font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-size:10,0000pt;\">&nbsp;</span></p></td><td style=\"width:113,4000pt;padding:0,0000pt 5,4000pt 0,0000pt 5,4000pt ;border-top:1,0000pt solid windowtext;mso-border-top-alt:0,5000pt solid windowtext;\" width=\"151\" valign=\"top\"><p class=\"MsoNormal\" style=\"margin-bottom:0,0000pt;text-align:center;\" align=\"center\"><b><span style=\"mso-spacerun:\'yes\';font-family:Arial;mso-fareast-font-family:\'Times New Roman\';font-weight:bold;font-size:10,0000pt;\">POR E</span></b><b><s